<script setup>
import GuestLayout from '@/Layouts/GuestLayout.vue';
import { CheckIcon, EyeIcon, EyeSlashIcon } from '@heroicons/vue/24/outline'
import { Head, Link, useForm } from '@inertiajs/vue3';
import { ref, computed } from 'vue';

const props = defineProps({
    // loginUrl: { type: String, default: '/storage/logo_app/5.svg' },
    loginUrl: { type: String, default: 'data:image/svg+xml;base64,' },
})

const form = useForm({
    name: '',
    email: '',
    password: '',
    password_confirmation: '',
});

const isFocused = ref({
    name: false,
    email: false,
    password: false,
    password_confirmation: false,
});

const submit = () => {
    form.post(route('register'), {
        onFinish: () => form.reset('password', 'password_confirmation'),
    });
};

const hasAnyPasswordRule = computed(() =>
    Object.values(passwordChecks.value).some(Boolean)
);

// Regex rules
const rules = {
    lowercase: /[a-z]/,
    uppercase: /[A-Z]/,
    number: /\d/,
    symbol: /[^A-Za-z0-9]/,
    minLength: 8,
}

// Computed validation
const passwordChecks = computed(() => ({
    lowercase: rules.lowercase.test(form.password),
    uppercase: rules.uppercase.test(form.password),
    number: rules.number.test(form.password),
    symbol: rules.symbol.test(form.password),
    length: form.password.length >= rules.minLength,
}))

const isPasswordValid = computed(() =>
    Object.values(passwordChecks.value).every(Boolean)
)

const showPassword = ref(false)

const toggleFocus = (field, status) => {
    isFocused.value[field] = status;
};
</script>

<template>
    <GuestLayout>

        <Head title="Register" />

        <div class="text-center mb-4 py-4">
            <div class="flex justify-center -mb-10 -mt-6 sm:-mt-12">
                <div class="no-select h-60 flex items-center justify-center">
                    <img :src="props.loginUrl" class="w-full mt-4 h-full object-cover" alt="Logo Sekolah">
                </div>
            </div>

            <div class="sm:hidden block -mb-10 py-4 no-select">
                <p class="mb-4 text-sm text-slate-500">Nusantara Learning Management System</p>
            </div>
        </div>

        <form @submit.prevent="submit" class="space-y-6">

            <!-- Name -->
            <div class="relative">
                <input id="name" type="text" v-model="form.name" placeholder="" required
                    @focus="toggleFocus('name', true)" @blur="toggleFocus('name', false)"
                    class="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:border-indigo-400 transition duration-300" />
                <label for="name" class="absolute left-4 bg-white px-1 transition-all duration-300 text-gray-400"
                    :class="{
                        '-top-2.5 text-sm text-indigo-500': form.name || isFocused.name,
                        'top-3 text-base': !form.name && !isFocused.name
                    }">
                    Username
                </label>
                <p v-if="form.errors.name" class="text-xs text-red-500 mt-1">{{ form.errors.name }}</p>
            </div>

            <!-- Email -->
            <div class="relative">
                <input id="email" type="email" v-model="form.email" placeholder="" required
                    @focus="toggleFocus('email', true)" @blur="toggleFocus('email', false)"
                    class="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:border-indigo-400 transition duration-300" />
                <label for="email" class="absolute left-4 bg-white px-1 transition-all duration-300 text-gray-400"
                    :class="{
                        '-top-2.5 text-sm text-indigo-500': form.email || isFocused.email,
                        'top-3 text-base': !form.email && !isFocused.email
                    }">
                    Email Address
                </label>

                <p v-if="form.errors.email" class="text-xs text-red-500 mt-1">{{ form.errors.email }}</p>
            </div>

            <!-- Password -->
            <div class="relative">
                <input id="password" :type="showPassword ? 'text' : 'password'" v-model="form.password" required
                    @focus="toggleFocus('password', true)" @blur="toggleFocus('password', false)"
                    class="w-full px-4 py-3 pr-12 border rounded-lg focus:outline-none transition duration-300" :class="isPasswordValid
                        ? 'border-gray-300'
                        : 'border-gray-300 focus:border-indigo-400'" />

                <!-- Floating Label -->
                <label for="password" class="absolute left-4 bg-white px-1 transition-all duration-300" :class="{
                    '-top-2.5 text-sm text-indigo-500': form.password || isFocused.password,
                    'top-3 text-base text-gray-400': !form.password && !isFocused.password
                }">
                    Password
                </label>

                <!-- Toggle Eye Icon -->
                <button type="button" @click="showPassword = !showPassword"
                    class="absolute right-3 top-3.5 text-gray-400 hover:text-gray-600 transition">
                    <EyeIcon v-if="!showPassword" class="w-5 h-5" />
                    <EyeSlashIcon v-else class="w-5 h-5" />
                </button>

                <p class="mt-2 text-xs text-gray-500">
                    Your password must contain at least one uppercase letter, lowercase letter, number (09), special
                    character (!@#$%), and be at least 6 characters long.
                </p>

                <ul v-if="hasAnyPasswordRule" class="mt-1 text-xs space-y-1">
                    <li v-if="passwordChecks.lowercase" class="flex items-center gap-2 text-gray-500 animate-fade-in">
                        <CheckIcon class="w-4 h-4 text-green-600" />
                        <span>Lowercase (az)</span>
                    </li>

                    <li v-if="passwordChecks.uppercase" class="flex items-center gap-2 text-gray-500 animate-fade-in">
                        <CheckIcon class="w-4 h-4 text-green-600" />
                        <span>Uppercase (AZ)</span>
                    </li>

                    <li v-if="passwordChecks.number" class="flex items-center gap-2 text-gray-500 animate-fade-in">
                        <CheckIcon class="w-4 h-4 text-green-600" />
                        <span>Number (09)</span>
                    </li>

                    <li v-if="passwordChecks.symbol" class="flex items-center gap-2 text-gray-500 animate-fade-in">
                        <CheckIcon class="w-4 h-4 text-green-600" />
                        <span>Special Character (!@#$%)</span>
                    </li>

                    <li v-if="passwordChecks.length" class="flex items-center gap-2 text-gray-500 animate-fade-in">
                        <CheckIcon class="w-4 h-4 text-green-600" />
                        <span>Min length 6 Characters</span>
                    </li>
                </ul>


                <!-- Error from backend -->
                <p v-if="form.errors.password" class="text-xs text-red-500 mt-1">
                    {{ form.errors.password }}
                </p>
            </div>

            <!-- Submit -->
            <div class="flex flex-col items-center space-y-4">
                <!-- <button type="submit" :disabled="form.processing"
                    class="w-full py-3 bg-gradient-to-br from-[#1e1b4b] via-[#312e81] to-[#4c1d95] hover:from-[#2d234b] hover:via-[#4a34a3] hover:to-[#7b3fe2] text-white font-semibold rounded-lg shadow-lg transition tracking-widest duration-300 disabled:opacity-70 disabled:cursor-not-allowed flex items-center justify-center gap-3"> -->
                <button type="submit" :disabled="form.processing"
                    class="w-full py-3 bg-gradient-to-br from-[#063970] via-[#0a4e8c] to-[#0f6ab4] hover:from-[#052c5a] hover:via-[#09406f] hover:to-[#0c5490] text-white font-semibold rounded-lg shadow-lg transition tracking-widest duration-300 disabled:opacity-70 disabled:cursor-not-allowed flex items-center justify-center gap-3">
                    <!-- Spinner -->
                    <svg v-if="form.processing" class="w-5 h-5 animate-spin text-white"
                        xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                        <circle class="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" stroke-width="4" />
                        <path class="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8v4a4 4 0 00-4 4H4z" />
                    </svg>

                    <!-- Text -->
                    <span :class="form.processing ? 'opacity-80' : 'opacity-100'"
                        class="transition-opacity duration-200">
                        {{ form.processing ? 'Creating your account...' : 'REGISTER' }}
                    </span>
                </button>

                <small class="text-gray-500 pb-6">Already have an account?
                    <Link :href="route('login')" prefetch preserve-scroll preserve-state :only="[]"
                        class="font-semibold text-blue-600 hover:text-blue-700 hover:underline">
                        Sign In
                    </Link>
                </small>
            </div>

        </form>
    </GuestLayout>
</template>
